import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class GlobalService {

  constructor() { }

  upLogo = 'data:image/png;base64,';





  sumPropertyValue = function(items, prop) {
    return items.reduce(function(a, b) {
      return parseFloat(a) + parseFloat(b[prop]);
    }, 0);
  };
}
